import React,{useEffect,useState} from 'react'
import { http } from '../../axios'
import './index.css'

function ViewItem() {
    const [viewdata,setviewData] = useState([])
    useEffect(() => {
        http.get("purches/tempItems")
            .then(res=>{
                console.log(res.data)
                setviewData(res.data)
            })
            .catch(err=>{
                console.log(err)
            })
    }, [])
    return (
        <div>
            {
                viewdata.map(data=>{
                    console.log("data",data)
                    return(
                    <div className="viewItems" key={data._id}>
                        <table className="table">
                            <thead>  
                                <tr>
                                    <th>Product</th>
                                    <th>HSNNO</th>
                                    <th>MRP</th>
                                    <th>Quantity</th>
                                    <th>Rate</th>
                                    <th>total</th>
                                    <th>GST</th>
                                    <th>total</th>                                   
                                </tr>
                            </thead>
                        </table>
                    </div>
                )})
            }
        </div>
    )
}

export default ViewItem
